krpano.action:
set(layer[datetime_bar].width, 350);
    set(layer[datetime_bar].height, 50);
    set(layer[datetime_bar].align, 'centertop');
    set(layer[datetime_bar].y, 10);

    set(layer[calendar_popup].width, 346);
    set(layer[calendar_popup].height, 340);
    set(layer[calendar_popup].y, 70);

if(layer[time_dropdown_list].visible == true,
        set(layer[time_dropdown_list].visible, false);
        js(setTimeDropdownIcon("&#9660;"));
        set(layer[time_tooltip].css, "color:#ffffff; font-size:16px; font-family:Arial; display:flex;");
        set(layer[time_tooltip].bgalpha, 0.8);
        ,
        set(layer[time_dropdown_list].visible, true);
        js(setTimeDropdownIcon("&#9650;"));
        set(layer[time_tooltip].css, "display:none;");
        set(layer[time_tooltip].bgalpha, 0);
        );

var krpano = document.getElementById("krpanoSWFObject");
var captureUrl = args[1];

// Load the new time's capture
if (captureUrl) {
    console.log("Redirecting to Time capture:", captureUrl);
    window.location.href = captureUrl;
} else {
    console.warn("No capture URL available for this time:");
}

var krpano = document.getElementById("krpanoSWFObject");
var calendarPopup = krpano.get("layer[calendar_popup].visible");
krpano.set("layer[calendar_popup].visible", !calendarPopup);

if (!calendarPopup) {
    krpano.set("layer[date_tooltip].css", "display:none;");
    krpano.set("layer[date_tooltip].bgalpha", 0);
    updateCalendarGrid();
}else{
    krpano.set("layer[date_tooltip].css", "color:#ffffff; font-size:16px; font-family:Arial; display:flex;");
    krpano.set("layer[date_tooltip].bgalpha", 0.8);
}

if(layer[dropdown_list].visible == true, 
    set(layer[dropdown_list].visible, false);
    js(setDropdownIcon("▼"));
    set(layer[floor_tooltip].css, "color:#ffffff; font-size:16px; font-family:Arial; display:flex;");
    set(layer[floor_tooltip].bgalpha, 0.8);
, 
    set(layer[dropdown_list].visible, true);
    js(setDropdownIcon("▲"));
    set(layer[floor_tooltip].css, "display:none;");
    set(layer[floor_tooltip].bgalpha, 0);
);

var krpano = document.getElementById("krpanoSWFObject");
var floorId = args[1];
var floorName = args[2];
var captureUrl = args[3];

// Hide options
krpano.set("layer[floor_options].visible", false);
krpano.set("layer[floor_options].enabled", false);

// Load the new floor's capture
if (captureUrl) {
    console.log("Redirecting to floor capture:", captureUrl);
    window.location.href = captureUrl;
    krpano.set("layer[selected_floor].html", floorName); //After 01-03-25 floor name set fix by LNX Team
} else {
    console.warn("No capture URL available for floor:", floorName);
}
